using System;
using System.Collections.Generic;
using System.Linq;

namespace MetaGraffiti.Base.Modules.Geo.Data
{
	public class GeoRegionData
	{
		// ==================================================
		// Constructors
		public GeoRegionData(int country, int id, int division, string iso, string abbr, string name, string nameLocal, double latCenter, double lonCenter, double latNorthWest, double lonNorthWest, double latSouthEast, double lonSouthEast)
		{
			CountryID = country;
			RegionID = id;

			RegionDiv = division;
			RegionName = name;

			RegionISO = iso.ToUpperInvariant();
			RegionAbbr = (String.IsNullOrWhiteSpace(abbr) ? "" : abbr); ;
			RegionNameLocal = (String.IsNullOrWhiteSpace(nameLocal) ? "" : nameLocal);

			Center = new GeoLocation(latCenter, lonCenter);
			Bounds = new GeoRectangle(latNorthWest, lonNorthWest, latSouthEast, lonSouthEast);
		}

		// ==================================================
		// Properties
		public int RegionID { get; private set; }
		public int CountryID { get; private set; }

		public int RegionDiv { get; private set; }

		public string RegionISO { get; private set; }
		public string RegionAbbr { get; private set; }
		public string RegionName { get; private set; }
		public string RegionNameLocal { get; private set; }

		public IGeoLatLon Center { get; private set; }
		public GeoRectangle Bounds { get; private set; }

		public GeoCountryData Country { get { return GeoCountryData.ByID(CountryID); } }

		// ==================================================
		// Static Factory

		public static GeoRegionData ByID(int regionID)
		{
			return All.FirstOrDefault(x => x.RegionID == regionID);
		}

		public static GeoRegionData ByISO(string iso)
		{
			if (String.IsNullOrWhiteSpace(iso)) return null;
			return All.FirstOrDefault(x => x.RegionISO == iso.ToUpperInvariant());
		}

		public static GeoRegionData ByAbbr(string abbr)
		{
			if (String.IsNullOrWhiteSpace(abbr)) return null;
			return All.FirstOrDefault(x => x.RegionAbbr == abbr.ToUpperInvariant());
		}

		public static GeoRegionData ByName(string name)
		{
			return All.FirstOrDefault(x => String.Compare(x.RegionName, name, true) == 0);
		}

		public static List<GeoRegionData> ListByCountry(int countryID)
		{
			return All.Where(x => x.CountryID == countryID).ToList();
		}

		public static List<GeoRegionData> ListByLocation(IGeoLatLon point)
		{
			return All.Where(x => x.Bounds.Contains(point)).ToList();
		}

